import React from 'react';
import { deleteAsync } from "../API/API";

const mapper = function(reapir) {

    return (
        <>
            <td className="col-md-2">{reapir.nom}</td>
            <td className="col-md-2">{reapir.prenom}</td>
            <td className="col-md-4">{reapir.adressemail}</td>
            <td className="col-md-1">{reapir.garage_fk}</td>
            <td className="col-md-2">
                <button type="button" className="btn btn-primary" onClick={() => window.location.pathname = "Mechanic/Edit/"+reapir.id}>Modifier</button>
                <button type="button" className="btn btn-danger"  onClick={async()=>  await deleteAsync("mecano/", reapir.id)}>Supprimer</button>
            </td>
        </>
    );
};

export default mapper;
